import swal from "sweetalert2";
export default {
  name: "Selecao_nome",
  data: function data() {
    return {
      autorizacao: false,
      naipes: ['Cordas', 'Madeiras', 'Metais'],
      nome: ""
    };
  },
  created: function created() {
    this.AtualizarNomes();
  },
  methods: {
    SelecionarCaracteristicas: function SelecionarCaracteristicas(nome) {
      /*console.log(
        "modificar caracteristicas " +
          nome +
          " de acordo com o instrumento selecionado!"
      );*/
      this.$emit("nome_instrumento", {
        nome: this.nome
      });
    },
    AtualizarNomes: function AtualizarNomes() {
      var _this = this;

      this.nomes = [];
      var usuarioAutorize = sessionStorage.getItem("usuario");
      this.autorizacao = JSON.parse(usuarioAutorize);
      this.$http.get(this.$url + "NomeInstrumento/v1", {
        headers: {
          authorization: "Bearer " + this.autorizacao.accessToken
        }
      }).then(function (response) {
        //console.log(response.status);
        if (response.status == 200) {
          //console.log("request ok! ", new Date().toISOString().substr(0, 16));
          response.data.forEach(function (element) {
            //console.log("Pós cadastro", element.nome);
            _this.nomes.push(element.nome);
          });
        } else if (response.status == 401) {}
      }).catch(function (e) {
        swal.fire("Sua autorização expirou!", "Entre com suas credencias novamente.", "warning");

        _this.$router.push("/"); //console.error(e);
        //console.data(e.data);

      });
    }
  }
};
